import React, { Component } from 'react'

class Header extends Component {

    render() {
        return (
            <div className="header">
                <h1>Zoe Steel</h1>
                <h2>Front End Developer</h2> 
                <h2>Vancouver, B.C.</h2>
            </div>
        )
    }
}

export default Header;
